import React from 'react';
import MessageDisplay from './MessageDisplay';

const App = () => {
  const messageToShow = 'Ceci est un message à afficher !';

  return (
    <div>
      <h1>Mon Application</h1>
      <MessageDisplay message={messageToShow} />
    </div>
  );
};

export default App;
